// CÁLCULO DA INCLINAÇÃO
function dp_calculo_inclinacao(){
    if (document.querySelector(".op2").classList.contains("ativo2")){
        dp_a_inc_valor = document.getElementById("dp_a_inc").value
        dp_l_inc_valor = document.getElementById("dp_l_inc").value
        
        if (dp_a_inc_valor<7.5 || dp_l_inc_valor>=15){
            dp_an = 1          
        }
        
        else if(dp_a_inc_valor>=7.5 && dp_l_inc_valor==1){
            dp_an = 2      
        }

        else if(dp_a_inc_valor>=7.5 && dp_l_inc_valor==2){
            dp_an = 1.7     
        }

        else if(dp_a_inc_valor>=7.5 && dp_l_inc_valor==3){
            dp_an = 1.55     
        }

        else if(dp_a_inc_valor>=7.5 && dp_l_inc_valor==4){
            dp_an = 1.4      
        }

        else if(dp_a_inc_valor>=7.5 && dp_l_inc_valor==5){
            dp_an = 1.3    
        }

        else if(dp_a_inc_valor>=7.5 && dp_l_inc_valor==7.5){
            dp_an = 1.15      
        }

        else if(dp_a_inc_valor>=7.5 && dp_l_inc_valor==10){
            dp_an = 1.1      
        }

        else if(dp_a_inc_valor>=7.5 && dp_l_inc_valor==15){
            dp_an = 1     
        }

        else if(dp_a_inc_valor>=7.5 && dp_l_inc_valor>1 && dp_l_inc_valor<2){
        dp_an = 2+(((1-dp_l_inc_valor)*(1.7-2))/(1-2))   
        }
        
        else if(dp_a_inc_valor>=7.5 && dp_l_inc_valor>2 && dp_l_inc_valor<3){
            dp_an = 1.7+(((2-dp_l_inc_valor)*(1.55-1.7))/(2-3))   
        }

        else if(dp_a_inc_valor>=7.5 && dp_l_inc_valor>3 && dp_l_inc_valor<4){
        dp_an = 1.55+(((3-dp_l_inc_valor)*(1.4-1.55))/(3-4))   
        }

        else if(dp_a_inc_valor>=7.5 && dp_l_inc_valor>4 && dp_l_inc_valor<5){
        dp_an = 1.4+(((4-dp_l_inc_valor)*(1.3-1.4))/(4-5))   
        }

        else if(dp_a_inc_valor>=7.5 && dp_l_inc_valor>5 && dp_l_inc_valor<7.5){
        dp_an = 1.3+(((5-dp_l_inc_valor)*(1.15-1.3))/(5-7.5))   
        }

        else if(dp_a_inc_valor>=7.5 && dp_l_inc_valor>7.5 && dp_l_inc_valor<10){
        dp_an = 1.15+(((7.5-dp_l_inc_valor)*(1.1-1.15))/(7.5-10))   
        }

        else if(dp_a_inc_valor>=7.5 && dp_l_inc_valor>10 && dp_l_inc_valor<15){
        dp_an = 1.1+(((10-dp_l_inc_valor)*(1-1.1))/(10-15))   
        }

        dp_ang = document.getElementById("dp_ang_inc").value
        dp_rad = dp_ang*(Math.PI/180)
        dp_sen = Math.sin(dp_rad)
        dp_cos= Math.cos(dp_rad)
        
        dp_f90d_c = dp_an*dp_fc0d*0.25
        
        if (document.querySelector(".nome2").classList.contains("ativo") || document.querySelector(".nome3").classList.contains("ativo") ){
            dp_f90d_m = dp_an*dp_fmd*0.25
        }

        else{
            dp_f90d_m = dp_f90d_c
        }

        dp_fa_c = (dp_fc0d*dp_f90d_c)/((dp_fc0d*dp_sen*dp_sen)+(dp_f90d_c*dp_cos*dp_cos))
        
        if (document.querySelector(".nome2").classList.contains("ativo") || document.querySelector(".nome3").classList.contains("ativo") ){
            dp_fa_m = (dp_fmd*dp_f90d_m)/((dp_fmd*dp_sen*dp_sen)+(dp_f90d_m*dp_cos*dp_cos))
        }
        
        else{
            dp_fa_m = dp_fa_c
        }

        dp_fc_final = dp_fa_c
        dp_fm_final = dp_fa_m

        console.log(dp_fa_c)
        console.log(dp_fa_m)
        console.log(dp_a_inc_valor)
        console.log(dp_l_inc_valor)
        console.log(dp_an)
}
    
    else if(document.querySelector(".op1").classList.contains("ativo2")){
        dp_fc_final = dp_fc0d
        dp_fm_final = dp_fmd
        console.log(dp_fa_c)
        console.log(dp_fa_m)
    }
}

